                    if ($('body').hasClass('home')) {
                        $('body').removeClass('header-collapse');
                        $('nav').removeClass('navbar-fixed-top');
                    }
                    $('body').removeClass('mobile-view mobile-view-collapsed');
                    $('.sub-nav-menu__header').removeClass('sub-nav-menu__header--mobile');
